  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Koyukuk/Nowitna
  National Wildlife Refuge Complex outlines Refuge accomplishments during the 1999
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. The report includes a planning section which discusses research and
  investigations. Refuge administration is outlined; information about personnel,
  volunteer programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, forests, fire management, and wilderness areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, and marking and bird banding. The public uses of the Refuge described
  in this report include outdoor classrooms, hunting, and law enforcement. The equipment
  and facilities section of the report provides information about rehabilitation,
  equipment replacement, communication systems, and computer systems. Cooperative
  programs are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
